import React from "react";
import { Card } from "antd";
import { RetweetOutlined } from "@ant-design";

const PostCard = ({ post }) => {
    return (
        <div>
            <Card
                cover={post.Images[0] && <PostImages images={post.Images} />}
                actions={[<RetweetOutlined />]}
            >
                <Image />
                <Content />
                <Buttonss></Buttonss>
            </Card>
            <CommentForm />
            <Comments />
        </div>
    );
};

export default PostCard;
